import React from 'react'
import './App.css'
import Navbars from './components/navbar'
import { BrowserRouter as Router,Route,Link} from "react-router-dom"


class App extends React.Component{

render(){
  return(
    <Router>
    <Route  path="/" Component={<Navbars/>}/>
    </Router>
  )
}




}

export default App;
